import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import Typography from '@material-ui/core/Typography';
import CardMedia from '@material-ui/core/CardMedia';
import Button from '@material-ui/core/Button';
import ButtonGroup from '@material-ui/core/ButtonGroup';
import { useState, useEffect} from 'react';
import Divider from '@material-ui/core/Divider';

const useStyles = makeStyles((theme) =>({
  table: {
    minWidth: 650,
  },
  head: {
    fontWeight: 'bold',
  },
  cover: {
    width: 60,
    height: 60,
    margin: 20
  },
  root: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    '& > *': {
      margin: theme.spacing(1),
    },
  }
}));


class Paginate extends Comment {
  render(){
      return (
        <React.Fragment>
          <Typography variant='h4' style={{marginBottom: 40, marginTop: 100}}>Orders</Typography>
    
          <div >
            <ButtonGroup color="primary" aria-label="outlined primary button group">
              <Button >Pending</Button>
              <Button >Processed</Button>
              <Button >Shipped</Button>
              <Button >Delivered</Button>
              {/* <Button onClick={()=> filterOrder('delivered')} variant={delivered} >Delivered</Button> */}
            </ButtonGroup>
          </div>
        </React.Fragment>
      );
  }
}

export default Paginate;
